func n(d []byte) int {
	v, _ := strconv.Atoi(string(d))
	return v
}
func (obj *Artifact) Parse(d *xml.Decoder, start *xml.StartElement) error {
	var data []byte

	for {
		tok, err := d.Token()
		if err != nil {
			return err
		}
		switch t := tok.(type) {
		case xml.StartElement:
			switch t.Name.Local {
			case "abs_tile_x":
				data = nil
			case "abs_tile_y":
				data = nil
			case "abs_tile_z":
				data = nil
			case "holder_hfid":
				data = nil
			case "id":
				data = nil
			case "item":
				v := Item{}
v.Parse(d, &t)
obj.Item = v
			case "item_description":
				data = nil
			case "item_subtype":
				data = nil
			case "item_type":
				data = nil
			case "mat":
				data = nil
			case "name":
				data = nil
			case "page_count":
				data = nil
			case "site_id":
				data = nil
			case "structure_local_id":
				data = nil
			case "subregion_id":
				data = nil
			case "writing":
				data = nil
			default:
				fmt.Println("unknown field", t.Name.Local)
				d.Skip()
			}

		case xml.CharData:
			data = append(data, t...)

		case xml.EndElement:
			if t.Name.Local == start.Name.Local {
				return nil
			}

			switch t.Name.Local {
			case "abs_tile_x":
				obj.AbsTileX = n(data)
			case "abs_tile_y":
				obj.AbsTileY = n(data)
			case "abs_tile_z":
				obj.AbsTileZ = n(data)
			case "holder_hfid":
				obj.HolderHfid = n(data)
			case "id":
				obj.Id_ = n(data)
			case "item":
				
			case "item_description":
				obj.ItemDescription = string(data)
			case "item_subtype":
				obj.ItemSubtype = string(data)
			case "item_type":
				obj.ItemType = string(data)
			case "mat":
				obj.Mat = string(data)
			case "name":
				obj.Name_ = string(data)
			case "page_count":
				obj.PageCount = n(data)
			case "site_id":
				obj.SiteId = n(data)
			case "structure_local_id":
				obj.StructureLocalId = n(data)
			case "subregion_id":
				obj.SubregionId = n(data)
			case "writing":
				obj.Writing = n(data)
			default:
				fmt.Println("unknown field", t.Name.Local)
			}
		}
	}
}
